   .header{

   }
   .main{

   }

   	border-radius:15px;
   	margin-bottom:13px;
   }
   .search{
   	height:19.5%;
   	width:99.5%;
   
   	display:flex;
   	
   }
   .innerbox{
   	height:45%;
   	width:100%;

   	margin-bottom:25px;
   	display:flex;
   	border-radius:25px;
   	background-color:white;
   }
   input{
   	height:100%;
   	width:99.9%;
   	margin:auto;
   	border:none;

   }
   input::placeholder{
   	font-size:17px;
   	}
   .icons{
   	height:39.5%;
   	width:99.5%;
   
   }
   .innerbox1{
   	height:100%;
   	width:10%;
   
   }
   #k{
    height:100%;
    width:100%;
    border-radius-left:20px;
   }
   .innerbox2{
     height:100%;
     width:70%;
     
   }
  #s{
  	height:35%;
  	width:55%;
  	display:flex;
   	align-item:center;
   	justify-content:space-evenly;

  	margin-left:12px;
  	
   }
  
   	 
   	 button{
   	 	border:none;

   	 }
   	.side{

   	justify-content:center;	
   	align-content:center;
   	cursor:pointer;


   	}
   	 	.big{
   		height:100%;
   		width:88%;
   		

   	}
   	 	.block{
   		height:60%;
   		width:2.5%;

   	}
   .gb{
     height:80%;
     width:80%;
     color:white;
     cursor:pointer;
   }
   #d{
   	border-radius:60%;
   	background-color: #a9b3bc;

   }
   .last{
   	width:100%;
   	height:50%;
   
   	display:flex;
   	justify-content:space-evenly;

   }
   .box2{
   	height:100%;
   	width:12%;
   	cursor:pointer;
   	
   
   }
   .w{
   	height:55%;
   	width:80%;

   	margin:auto;
   }
